import React, { Component } from "react";

class Buttons extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <React.Fragment>
        <button type="button" className="btn btn-primary">
          Gainers
        </button>
        <button type="button" className="btn btn-primary">
          Losers
        </button>
        <button type="button" className="btn btn-primary">
          All
        </button>
        <button type="button" className="btn btn-primary">
          Most Active
        </button>
      </React.Fragment>
    );
  }
}

export default Buttons;
